import React, { useState } from 'react';
import { Box, Button, Text, Card, CardHeader,CardFooter,CardBody} from 'grommet';
import { Server, Magic } from 'grommet-icons';
import { Link, NavLink, Redirect, Route, Switch } from 'react-router-dom';
import NewFile from './NewFile';
// import TabsForm from './TabsForm';



function CardsForm() {

  const [neFile, setNeFile]= useState(true);

  if(!neFile){
    return <Redirect to="/NewFile" />
  }
  
    return(
        <Box direction="row" gap="large" pad="medium">
          <Card  height="small" width="medium" >
                <CardHeader>
                  <Button icon={<Magic />} onClick={() => {}} />
                </CardHeader>
                <CardBody pad={{horizontal: "small"}}>
                <Text weight="bold">Customs Annexure </Text>
                <Text size="xsmall">Part A, B, C, D, E, F, G</Text>
                </CardBody>
                <CardFooter pad="small"> 
                  <Button primary label="TabsForm" size="small" color="#00567A" onClick={() => setNeFile(false)} />
                </CardFooter>
          </Card>
          <Card  height="small" width="medium" background="#00567A">
                <CardHeader>
                  <Button icon={<Server />} onClick={() => {}} />
                </CardHeader>
                <CardBody pad={{horizontal: "small"}}>
                <Text weight="bold">Asset Tracker</Text>
                <Text size="xsmall">Part A, B, C, D</Text>
                </CardBody>
                <CardFooter pad="small">
                  <NavLink to="/NewFile"></NavLink>

                  <Button primary label="TabsForm" size="small" color="#00567A"/>

                  <Switch>
                    <Route component={NewFile}/>
                  </Switch>

                </CardFooter>
          </Card>

        </Box> 
    );
}


export default CardsForm;
